import React,{Component, Fragment} from 'react';
import { Container } from 'react-bootstrap';
import Navberr from "../components/home_component/Nav";
import Futer from '../components/home_component/Footer';
import '../asset/css/privacy.css';
class PrivacyPolicy extends Component{  
    render(){
        return (
        <Fragment>
            <Navberr />
              <div className='privacyBack'>
                <Container>
                    <div className="privacy-text">
                        <h2>Privacy Polacy Page</h2>
                        <p>এই গোপনীয়তা নীতি পৃষ্ঠায়, কীভাবে অতি সহজে একজন ওয়েব ডেভলপার হতে শিখবেন সে সম্পর্কে এখানে কিছু টিপস এবং কৌশল রয়েছে৷<br></br>
                           Here are some tips and tricks on how to learn to be a web developer easily on this privacy policy page.</p>
                        <p>আপনি যখন শিখবেন প্র্যাকটিস করবেন প্রতিদিন সকালে ভোরে উঠে প্র্যাকটিস করবেন, কারণ সকালে মানুষের মাথায় এগুলো মুখস্ত থাকে ভালো, এজন্য সকালে প্র্যাকটিস করবেন<br></br>
                           When you learn to practice, get up early every morning to practice because it is better to memorize them in the morning, so practice in the morning.</p>
                        <p>আপনি যদি প্রতিদিন কিছু সময়ের জন্য অতীতে শেখা পাঠগুলিকে রিভিশন করেন, তবে এগুলি আপনার হৃদয়ের গভীরে চলে যাবে এবং আপনি সেগুলি ভুলে যাবেন না।<br></br>
                           If you revistion the lessons learned in the past for a while every day, then these will go deep into your heart and you will not forget them.</p>
                        <p></p>
                        <p></p>
                        <p></p>
                        <p></p>
                        <p></p>
                    </div>
                </Container>
              </div>
            <Futer />
        </Fragment>
        )
    }
}
export default PrivacyPolicy;
